import './App.css';
import Navbar from './components/Navbar';
import React from 'react';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
function App() {
  return (
        <Switch>
          <Route path='/' exact component={Navbar}/>
        </Switch>      
  );
}

export default App;
